import React from 'react';
import './TopHeader.css';

const TopHeader = () => {
  return (
    <div className="top-header">
      <div className="social-icons">
        <a href="#" className="social-icon facebook"><i className="icon-facebook"></i></a>
        <a href="#" className="social-icon twitter"><i className="icon-twitter"></i></a>
        <a href="#" className="social-icon instagram"><i className="icon-instagram"></i></a>
        <a href="#" className="social-icon email"><i className="icon-email"></i></a>
      </div>
      <div className="announcement">
        <p>AVOID UP TO 25% PRICE INCREASES NEXT MONTH - SHOP PRE-TARIFF DRESSES TODAY!</p>
      </div>
      <div className="contact-info">
        <a href="tel:+18554458001">(855) 445-8001</a>
      </div>
    </div>
  );
};

export default TopHeader;
